import React from 'react';

const VerifyEmail = () => {
  return (
    <div>
      <h2>Email Verification</h2>
      <p>
        A verification email has been sent to your email address. Please check your inbox and
        click on the link to verify your account.
      </p>
    </div>
  );
};

export default VerifyEmail;
